urnal_henesys_no1_content:"ヘネシスで書くはじめての冒険日記だね。今日はヘネシスで一番の古株だと言われている鍛冶屋の家に行こうと思ってジャンプしたら危うく落ちそうになったの。あのおじさん、どうして家の庭にあんなに大きな穴を作ってるんだろう？私ほど強いモンスターじゃない限り、この穴を飛び越えられるような子はあまりいないと思うんだけどね！とりあえず情報ももらえたし、おじさんがおすすめしてくれた食堂にでも行ってみようかな！",journal_henesys_no2_content:"食べ過ぎちゃった… 特に、あの食堂のお肉がすごく美味しかったね。どうすればあんなに柔らかくできるんだろう？！でも、その隣の店のパンはイマイチだったよ。どうやらパティシエさんが食べ物の修練を言い訳に毎日遊び回ってるみたい。そういう時間があるならもっとパンを作ってみるのがいいんじゃないかな。まぁ、お腹もいっぱいになったことだし、本格的に冒険をはじめてみようかな！",journal_ellinia_no1_title:"エリニア冒険日記 その1",journal_ellinia_no2_title:"エリニア冒険日記 その2",journal_ellinia_no1_content:"知らないうちにメイプルキノコを組み敷いてしまったよ… 怒られて当然だよね。 でもさ、だからといって一斉で攻撃してくることないんじゃない？ 本当に怖いやつらだよ。スライムたちが苦戦するのも分かっちゃうなぁ。 でも、このピンクビーン様がやっつけたからもう心配要らないよ！スライムたちも仲間に加わったことだし、もっとテンション上げて素敵な森を冒険してみよう！",journal_ellinia_no2_content:"冒険中に出会った友だち、ロイヤルフェアリーから最近エルナスに怖い噂が出回ってるって聞いたんだけど、なんだろう？今夜は友だちと家で遊ぶことになってるからその時に聞いてみよう。だって気になるんだもん～！ しかし、何を着ていけばいいんだろう…最近太りすぎて着れる洋服がないんだよね… まぁ、私はいつでも可愛いからどんな洋服を着てもみんな喜ぶだろうけどね！",journal_elnath_no1_title:"エルナス冒険日記 その1",journal_elnath_no2_title:"エルナス冒険日記 その2",journal_elnath_no1_content:"うわー！ これが噂の雪ってやつかな？私が住んでいる村はいつでも春だから、雪を見るのは初めてなんだ。モンスターたちのせいでちゃんと見る余裕がなかったんだけど、今見たら世界中がこんなにも真っ白で冷たくなってるなんてビックリだよ！ふわふわでキラキラしてるから美味しそうだなぁと思ったんだけど、特に味はなかった… でもね、甘いチョコシロップをかけて食べたら美味しそうじゃない？少しだけ持っていきたいんだけど持っていける方法がなくて残念だね。",journal_elnath_no2_content:"ペッペッペッ、間違えて石炭の粉を食べてしまったよ。あれもこれも全部悪いモンスターたちのせいだよ！逃げるなら静かに逃げればいいのに、石炭の粉を撒き散らしながら逃げるなんてね！おかげさまで私のツヤツヤで綺麗なピンク色の肌が汚れてちゃったじゃない！早くここを抜け出してお風呂に入りたい… いくら冒険が好きだと行っても、こんなに汚い格好をしたまま歩き回るのはこのピンクビーン様のプライドが許さないよ…",bug_report_alert_msg:"貴重なご意見ありがとうございます。",version_update_msg1:"最新バージョン(%1)を\nご利用いただけます。",version_update_msg2:"エントリーハードウェアの最新バージョン(%1)を\nご使用いただけます。",version_update_msg3:"いまアップデートしますか?",select_the_hardware:"Select the hardware<br />that you would use in the lesson.",select_hardware_button:"Select",select_the_expansion_block:"Select the expansion block that you would use in the lesson.",select_hardware_not_support_info:"ハードウェアブロックはオープンクラスに使用できない。",select_hardware_not_support_info2:"少々お待ちください。",select_expansion_block_